import React from 'react'

const Online = () => {
    return (
      <div>
        <div className="right-online">
          <div className="name">
            <h3>Jorjiy</h3>
            <p>online</p>
          </div>
          <div className="name-input">
            <i className="fas fa-search"></i>
            <i className="fas fa-ellipsis-v"></i>
          </div>
        </div>
      </div>
    );
}

export default Online;
